import './App.css';

function App() {
  return (
    <>
      <div className="container-fluid h-100">
        <div className="row h-100">
          <div className="col-sm-6 bg-primary pe-5">
            <h2 className="text-white text-end">Welcome to the portal</h2>
            <h1 className="text-uppercase text-end">Mintz Global Screening</h1>
          </div>
          <div className="col-sm-6">test</div>
        </div>
      </div>
    </>
  );
}

export default App;
